{% raw %}
<div style="overflow: auto; width: 100%; height: 100%; background-color: #000000; color: #ffffff; padding: 20px; font-family: sans-serif;">

{%- set cfxql_query2 = "conversationId is '" ~ context.conversationId ~ "' and reviewer is '" ~ context.reviewer ~ "' GET conversationLabel" -%}
{%- set convs = engine.query_stream_data("ai_observability", cfxql_query=cfxql_query2, sorting=[{"timestamp": "desc"}], limit=1) -%}

{#-- Extract conversation label from first entry (if available) --#}
{%- set conv_label = convs[0].get("conversationLabel", "No Label Found") if convs and convs|length > 0 else "No Label Found" -%}

{#-- Query review_rating entries by conversation and reviewer --#}
{%- set cfxql_query = "conversationId is '" ~ context.conversationId ~ "' and reviewer is '" ~ context.reviewer ~ "' and metric_name is 'review_rating'" -%}
{%- set reviews = engine.query_stream_data("ai_observability", cfxql_query=cfxql_query, sorting=[{"timestamp": "desc"}], limit=1000, max_rows=1000) -%}

{%- if reviews|length == 0 -%}
  <b style="color: #ff6666;">No rating reviews found for this conversation.</b>
{%- else -%}

  <div style="margin-bottom: 20px;">
    <h2 style="color: #00ffff;">👤 {{ context.reviewer }}</h2>
    <h3 style="color: #ffffff;">💬 {{ conv_label }}</h3>
  </div>

  {%- set ratings = reviews | map(attribute='metric_value') | list -%}
  {%- set avg_rating = (ratings | sum) / (ratings | length) -%}
  {%- set min_rating = ratings | min -%}
  {%- set max_rating = ratings | max -%}

  <div style="margin-bottom: 30px; color: #cccccc;">
    <p><b>📊 Average Rating:</b> {{ avg_rating | round(2) }}</p>
    <p><b>🔼 Max Rating:</b> {{ max_rating }}</p>
    <p><b>🔽 Min Rating:</b> {{ min_rating }}</p>
  </div>

  {%- for r in reviews -%}
    <div style="border-top: 1px solid #666; padding-top: 15px; margin-top: 15px;">
      <p><b>🕒 Timestamp:</b> {{ r.get("timestamp") }}</p>
      <p><b>🧑 Reviewer:</b> {{ r.get("reviewer", "N/A") }}</p>
      <p><b>⭐ Rating:</b> {{ r.get("metric_value", "N/A") }}</p>
      <p><b>👍 Positive:</b> {{ r.get("review_positive", "—") }}</p>
      <p><b>👎 Negative:</b> {{ r.get("review_negative", "—") }}</p>
    </div>
  {%- endfor -%}

{%- endif -%}
</div>
{% endraw %}
